import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect } from 'react';

function App() {
  const [testData, setTestData] = useState(0);

  useEffect(() => {
    fetch('http:localhost:5000/').then(res => res.json()).then(data => {
      setTestData(data);
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>
          {testData}
        </p>
      </header>
    </div>
  );
}

export default App;
